import React from "react";
import styled from "styled-components";
import img from "../assets/burger.png";
import {Link} from 'react-router-dom';
import { BiArrowBack } from "react-icons/bi";

function ViewMenu () {
  return (
    <Container>
    <Wrapper>
      <ArrowWrapper>
        <Link to="/sidebar">
          <BiArrowBack size="40px" color="#676666"/>
        </Link>
      </ArrowWrapper>
      <section>
          <Product />
      </section>
    </Wrapper>
    </Container>
  );
};

const Product = () => {
    return <article><Image></Image></article> 
};

const Image = () => <img src={img} alt="" />

const ArrowWrapper = styled.div`
  margin-top: 50px;
  margin-left: 30px;
`;

const Container = styled.div`
  background: #eefcff;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;
`;

const Wrapper = styled.div`
  background: rgb(255,140,140);
  background: linear-gradient(63deg, rgba(255,140,140,1) 0%, rgba(250,240,224,1) 60%, rgba(113,237,184,1) 100%);
  width: 100%;
  height: 100%;
  display: flex;
`;


export default ViewMenu;
